import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { useParams } from 'react-router-dom';
//import './TicketResponse.css';

const TicketResponse = () => {
  const { ticketId } = useParams();
  const [ticket, setTicket] = useState(null);
  const [messages, setMessages] = useState([]);
  const [newMessage, setNewMessage] = useState('');

  useEffect(() => {
    const fetchTicketDetails = async () => {
      try {
        const token = localStorage.getItem('token');
        const ticketRes = await axios.get(`http://localhost:5094/api/ticket/${ticketId}`, {
          headers: { Authorization: `Bearer ${token}` }
        });
        setTicket(ticketRes.data);

        const messagesRes = await axios.get(`http://localhost:5094/api/ticket/${ticketId}/messages`, {
          headers: { Authorization: `Bearer ${token}` }
        });
        setMessages(messagesRes.data);
      } catch (error) {
        console.error('Veriler alƒ±namadƒ±:', error);
      }
    };

    fetchTicketDetails();
  }, [ticketId]);

  const handleSendMessage = async () => {
    if (!newMessage.trim()) return;

    try {
      const token = localStorage.getItem('token');
      const res = await axios.post(`http://localhost:5094/api/ticket/${ticketId}/messages`, {
        content: newMessage
      }, {
        headers: { Authorization: `Bearer ${token}` }
      });

      setMessages(prev => [...prev, res.data]);
      setNewMessage('');
    } catch (error) {
      console.error('Mesaj g√∂nderilemedi:', error);
    }
  };

  if (!ticket) return <div>Y√ºkleniyor...</div>;

  return (
  <div className="container">
    <div className="main-grid">
      <div className="form-box">
        <h2>Yeni Talep Olu≈ütur</h2>
        <form onSubmit={handleSubmit}>
          <label>A√ßƒ±klama</label>
          <textarea
            value={description}
            onChange={(e) => setDescription(e.target.value)}
            placeholder="Talep a√ßƒ±klamasƒ±nƒ± yazƒ±nƒ±z..."
            rows="4"
            required
          />

          <label>Kategori</label>
          <select value={categoryId} onChange={(e) => setCategoryId(e.target.value)} required>
            <option value="">Kategori Se√ßin</option>
            {categories.map((cat) => (
              <option key={cat.categoryId} value={cat.categoryId}>{cat.name}</option>
            ))}
          </select>

          <label>√ñncelik</label>
          <select value={priorityId} onChange={(e) => setPriorityId(e.target.value)} required>
            <option value="">√ñncelik Se√ßin</option>
            {priorities.map((pri) => (
              <option key={pri.priorityId} value={pri.priorityId}>{pri.name}</option>
            ))}
          </select>

          <button type="submit">G√∂nder</button>
        </form>
      </div>

      <div className="ticket-grid ag-theme-alpine">
        <h3>Mevcut Talepler</h3>
        <AgGridReact
          rowData={tickets}
          modules={[ClientSideRowModelModule]}
          onRowDoubleClicked={(event) => navigate(`/ticket/${event.data.id}`)}
          columnDefs={columnDefs}
          domLayout="autoHeight"
          pagination={true}
          paginationPageSize={5}
        />
      </div>
    </div>

    <div className="sidebar right">
      <div className="logo">HelpDesk</div>
      <ul className="nav">
        <li><span className="icon">üé´</span> <span className="label">Tickets</span></li>
        <li><span className="icon">üë•</span> <span className="label">Agents</span></li>
        <li><span className="icon">‚öôÔ∏è</span> <span className="label">Settings</span></li>
      </ul>
      <div className="profile">
        <img src="https://i.pravatar.cc/40" alt="user" />
        <span>User</span>
      </div>
    </div>
  </div>
);

};

export default TicketResponse;
